import React from 'react';
import styles from './Toolbar.module.css';
import style from '../../Logo/Logo.module.css';

const toolbar = (props) => (
    <header className={styles.Toolbar}>
        <div>MENU</div>
        <div className={style.burgerLogo}>LOGO</div>
        <nav>
            ...
        </nav>
    </header>
);

export default toolbar
